import React, { useState } from "react";
import { motion } from "framer-motion";

// Basic glass lightbox modal
function LightboxModal({ open, onClose, children }) {
    if (!open) return null;
    return (
        <div style={{
            position: "fixed", top: 0, left: 0, width: "100vw", height: "100vh",
            background: "rgba(40,45,140,0.14)", zIndex: 50,
            display: "flex", alignItems: "center", justifyContent: "center"
        }}>
            <div style={{
                background: "rgba(255,255,255,0.83)", borderRadius: 18,
                maxWidth: 560, width: "95vw", boxShadow: "0 9px 32px #22275233",
                padding: "24px 17px", position: "relative"
            }}>
                <button
                    style={{
                        position: "absolute", top: 12, right: 18, fontSize: 27,
                        background: "none", border: "none", color: "#6E84CB",
                        cursor: "pointer", fontWeight: 900
                    }}
                    onClick={onClose}
                >Ã—</button>
                {children}
            </div>
        </div>
    );
}
function ParallaxDiagram() {
    return (
        <motion.div
            initial={{ y: 60, opacity: 0 }}
            whileInView={{ y: 0, opacity: 1 }}
            transition={{ duration: 0.8, type: "spring" }}
            style={{
                margin: "39px 0",
                display: "flex", justifyContent: "center", alignItems: "center",
                width: "100%", height: 150, background: "linear-gradient(90deg,#c7d8f7,#edf2fb)",
                borderRadius: 14, boxShadow: "0 2px 18px #deeaff70"
            }}
        >
            <span style={{ color: "#527DCA", fontWeight: 700, fontSize: 23 }}>[Parallax System Diagram]</span>
        </motion.div>
    );
}

export default function EventManagementCaseStudy() {
    const [showDiagram, setShowDiagram] = useState(false);

    return (
        <div style={{
            maxWidth: 820,
            margin: "27px auto",
            padding: "2.2rem 1rem 3rem 1rem",
            background: "#fff",
            borderRadius: 22,
            boxShadow: "0 2px 33px #b1bee744, 0 1.5px 9px #7B9ACC12",
            textAlign: "center"
        }}>
            <h1 style={{ fontWeight: 900, fontSize: 34, color: "#7B9ACC", marginBottom: 22, marginTop: 10 }}>Event Management & Ticketing System</h1>
            <p style={{ fontSize: 18, color: "#567", marginBottom: 14 }}>
                Case study: scalable event management, analytics, and secure payments architecture.
            </p>
            <button
                onClick={() => setShowDiagram(true)}
                style={{
                    background: "#7B9ACC", color: "#fff",
                    borderRadius: "1em", fontWeight: 700,
                    padding: "9px 23px", margin: "15px auto 18px auto",
                    fontSize: 18, boxShadow: "0 3px 18px #7B9ACC32",
                    border: "none", cursor: "pointer"
                }}
            >
                Explore Architecture
            </button>
            <div style={{ display: "flex", flexWrap: "wrap", gap: 15, justifyContent: "center", marginBottom: 22 }}>
                {[
                    ["Stack", "React, Node, Express, MongoDB, Full Stack"],
                    ["Integration", "Payments, Social, Analytics"],
                    ["Scale", "10K+ events/month"],
                    ["PCI DSS", "Compliant"]
                ].map(([title, text]) => (
                    <div key={title} className="glass-card" style={{
                        minWidth: 130, maxWidth: 220, padding: "13px 8px", borderRadius: 18,
                        boxShadow: "0 2px 11px #ddeaf810", background: "rgba(255,255,255,0.73)",
                        fontWeight: 500, color: "#527DCA", marginBottom: 5
                    }}>
                        <span style={{ fontWeight: 700 }}>{title}:</span> <span style={{ color: "#212752" }}>{text}</span>
                    </div>
                ))}
            </div>
            <LightboxModal open={showDiagram} onClose={() => setShowDiagram(false)}>
                <ParallaxDiagram />
                <div style={{ marginTop: 15, color: "#527DCA", fontWeight: 700 }}>
                    Detailed system architecture diagram.
                </div>
            </LightboxModal>
            <div className="glass-card" style={{
                padding: "21px 13px", borderRadius: 18, margin: "30px auto 15px auto",
                boxShadow: "0 2px 13px #ddeaf833"
            }}>
                <h2 style={{ fontWeight: 800, fontSize: 21, color: "#7B9ACC", marginBottom: 12 }}>
                    Project Goals
                </h2>
                <ul style={{ textAlign: "left", maxWidth: 650, margin: "0 auto", color: "#434e6e", fontSize: 16, lineHeight: 1.7 }}>
                    <li>Real-time seat selection and analytics</li>
                    <li>Dynamic pricing, mobile-first UX</li>
                    <li>Secure payments and attendance tracking</li>
                    <li>Organizer dashboard, post-event insights</li>
                    <li>Robust, scalable microservices architecture</li>
                </ul>
            </div>
            <div className="glass-card" style={{
                padding: "21px 13px", borderRadius: 18, margin: "23px auto", boxShadow: "0 2px 13px #ddeaf833"
            }}>
                <h2 style={{ fontWeight: 800, fontSize: 21, color: "#7B9ACC", marginBottom: 12 }}>
                    My Contribution & Architecture Highlights
                </h2>
                <ul style={{ textAlign: "left", maxWidth: 650, margin: "0 auto", color: "#434e6e", fontSize: 16, lineHeight: 1.7 }}>
                    <li><b>Role:</b> Architected microservices, built core API, payment & real-time modules.</li>
                    <li><b>Result:</b> 10,000+ concurrent users, sub-second ticket processing, 99.9% uptime.</li>
                    <li><b>Lesson:</b> Trade-offs in security vs. flexibility, contract-based API, serverless scaling.</li>
                </ul>
            </div>
        </div>
    );
}
